import React from "react";
import "./biosection.css";
import face from "./face.png";

function Biosection() {
  return (
    <div className="biosection">
      <div className="artistbio">
        <h1>ARTIST'S BIO</h1>
        <img src={face} alt="" />
      </div>
      <p>
        Joan Cornellà Vázquez (born 1981, Barcelona) is a Spanish cartoonist and
        illustrator known for using powerful black humour in his iconic artwork
        and comics. Cornellà's creations are light-hearted and playful on the
        surface, featuring a cheerful palette and figures with generic grins.
        Upon deeper contemplation, however, his works communicate a potent,
        astute and nuanced satire on the nature of human existence. Poking fun
        at sensitive and taboo topics with a fluid hand and minimal visual
        clues, Cornellà cuts to the core of the unnerving essence of our times.
        With over eight million followers on social media, Cornellà is
        highly-regarded on the international stage. His works have graced the
        art scenes from Hong Kong, Tokyo, Seoul and Beijing to London, Paris and
        New York. With a simple visual language and cheerful palette, Cornellà
        uses satire to comment on the bleak side of human nature, creating works
        that are honest, entertaining and stimulating.
      </p>
    </div>
  );
}

export default Biosection;
